import React from "react";
import { Link, BrowserRouter } from 'react-router-dom';

class Sidebar extends React.Component {
  render() {
    const { open } = this.props;
    return (
      <>
        <section className={`dark-background ${open ? "open" : ""}`} />
        <section className={`Sidebar ${open ? "open" : ""}`}>

          <h4> Curso

          </h4>
          <nav>
          <Link to={'/calendar'}>
              Agenda
            </Link>
            <Link to={'/live-lectures'}>
              Aulas Ao Vivo
            </Link>
            <Link to={'/trybe-talks'}>
              Trybe Talks
            </Link>
            <Link to={'/solutions'}>
              Gabarito
            </Link>
          </nav>
        </section>
      </>
    );
  }
}

export default Sidebar;
